import { Select } from 'antd';
import React from 'react';
const { Option } = Select;
const children = [];

for (let i = 10; i < 36; i++) {
  children.push(<Option key={i.toString(36) + i}>{i.toString(36) + i}</Option>);
}

const handleChange = (value) => {
  console.log(`selected ${value}`);
};

const App = () => (
  <div style={{
    padding:10
  }} >
  <Select
    mode="tags"
    style={{
      width: '80%',      
    }}
    onChange={handleChange}
    tokenSeparators={[',']}
  >
    {children}
  </Select>
  </div>
);

export default App;
